import React, { useState } from 'react';
import './Header.scss';

const Header = () => {
	return (
		<>
			<div id="header">
				<div className="container">
					<div className="options">
						<div className="profileName">Name</div>
						<div className="logout">logout</div>
					</div>
				</div>
			</div>
		</>
	);
};

export default Header;
